 p_id=>wwv_flow_imp.id(7617740471240945)
,p_name=>'Admin_user'
,p_scheme_type=>'NATIVE_FUNCTION_BODY'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    v_role users.role%TYPE;',
'BEGIN',
'    SELECT role',
'    INTO v_role',
'    FROM users',
'    WHERE UPPER(username) = UPPER(:APP_USER);',
'',
'    RETURN v_role = ''Admin'';',
'EXCEPTION',
'    WHEN NO_DATA_FOUND THEN',
'        RETURN FALSE;',
'END;'))
,p_error_message=>'You are not an Admin!'
,p_version_scn=>13136297
,p_caching=>'BY_USER_BY_PAGE_VIEW'
);
end;
